import React from 'react'

const laptop = [
    {
        nama: 'Laptop Dell',
        harga: 3000000
    },

    {
        nama: 'Laptop Hp',
        harga: 2700000
    },

    {
        nama: 'Laptop Lenovo',
        harga: 3500000
    },

    {
        nama: 'Laptop Asus',
        harga: 2900000
    }
]

const Map = () => {
    return (
        <div>
         <h2>Map</h2>   
        <ol>
            {laptop.map((barang) => (
                <li>{barang.nama}</li>
            ))}
        </ol>
        </div>

    )
}

export default Map
